def has_rotation_solution(ax: int, ay: int, bx: int, by: int, cx: int, cy: int) -> str:
    """"""
    ab = (ax - bx) * (ax - bx) + (ay - by) * (ay - by)
    bc = (cx - bx) * (cx - bx) + (cy - by) * (cy - by)
    line = (ax - cx) * (by - ay) == (bx - ax) * (ay - cy)
    if ab == bc and (not line):
        return 'Yes'
    else:
        return 'No'
